e1r salakos versenyt j\u00e1tszani \u00e9s azt is rem\u00e9lem, hogy meglesz a Roland Garros egy picit kedvez\u0151bb k\u00f6r\u00fclm\u00e9nyek mellett.\n\nTudom, hogy ez mindenki sz\u00e1m\u00e1ra neh\u00e9z id\u0151szak, tartsatok ki ti is!\ud83d\ude18\n \n\n#mikorlesztenisz #tennis #when #where #how"}}]},"edge_media_to_comment":{"count":43},"comments_disabled":false,"taken_at_timestamp":1595257395,"edge_liked_by":{"count":2095},"edge_media_preview_like":{"count":2095},"location":null,"thumbnail_src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c0.90.720.720a/s640x640/109209668_282438712987972_8888810724594111470_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=104\u0026_nc_ohc=34hT0mhsyR4AX8RYUv4\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=9f86ec07c853ad1b0f48ac059de42f48\u0026oe=619B945F\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.90.720.720a/s150x150/109209668_282438712987972_8888810724594111470_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=104\u0026_nc_ohc=34hT0mhsyR4AX8RYUv4\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=020d156bfe3e4d4581830d2ebeea4d94\u0026oe=619B872B\u0026_nc_sid=7bff83","config_width":150,"config_height":150},{"src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.90.720.720a/s240x240/109209668_282438712987972_8888810724594111470_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=104\u0026_nc_ohc=34hT0mhsyR4AX8RYUv4\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=46e251e751f07d47adb1ebe6da56f8db\u0026oe=619B48AD\u0026_nc_sid=7bff83","config_width":240,"config_height":240},{"src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.90.720.720a/s320x320/109209668_282438712987972_8888810724594111470_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=104\u0026_nc_ohc=34hT0mhsyR4AX8RYUv4\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=5151f0069389896c695549b09c392e55\u0026oe=619B1E93\u0026_nc_sid=7bff83","config_
